/**
 * @param {number[]} nums
 * @param {number} limit
 * @return {number[]}
 */
var lexicographicallySmallestArray = function(nums, limit) {
    let n = nums.length;
    let sorted = Array.from(nums).sort((a, b) => a - b);
    let map = new Map();

    for (let i = 0; i < n; i++) {
        if (!map.has(sorted[i])) map.set(sorted[i], []);
        map.get(sorted[i]).push(i);
    }

    let tree = new Array(n + 1).fill(0);

    function update(i, val) {
        for (i++; i <= n; i += i & -i) tree[i] += val;
    }

    function query(i) {
        let sum = 0;
        for (i++; i > 0; i -= i & -i) sum += tree[i];
        return sum;
    }

    for (let i = 0; i < n; i++) {
        let positions = map.get(nums[i]);
        let targetPos = positions.shift();
        let actualPos = targetPos - query(targetPos);
        while (actualPos < i) {
            targetPos = positions.shift();
            if (targetPos === undefined) break;
            actualPos = targetPos - query(targetPos);
        }
        if (targetPos !== undefined) {
            update(targetPos, 1);
            nums[i] = nums.splice(actualPos, 1, nums[i])[0];
        }
    }
    return nums;
};
